		"text": "불법 거래(프리미엄 티켓 거래)는 법적인 책임이 뒤따르는 위법 행위이므로 티켓은 반드시 지정된 예매처에서만 예매하시기 바랍니다.\n\n아래와 같이 부정 티켓 거래 유형 및 피해 사례에 대해 사전 안내 드리오니 추후 피해를 겪지 않도록 관객 여러분의 유의와 양해 부탁드립니다."
